import React from 'react';
import { ITabContentProps } from '../types/types';

const TabContent = (props: ITabContentProps): JSX.Element => {

    const {
        id,
        heading,
        faIcon,
    } = props

    return (
        <>
            <div className="sidebar-pane active" id={id}>
                <h1 className="sidebar-header">
                    {heading}
                    <span className="sidebar-close"><i className={faIcon}></i></span>
                </h1>
            </div>
        </>
    )
}

export default TabContent;
